    "<%= user %> already in exception list.": "<%= user %> \u00e4lr\u00e9\u00e4d\u00fd \u00efn \u00e9x\u00e7\u00e9pt\u00ef\u00f6n l\u00efst. \u2c60'\u03c3\u044f\u0454\u043c \u03b9\u03c1\u0455\u03c5\u043c \u2202\u03c3\u0142\u03c3\u044f \u0455\u03b9\u0442 \u03b1\u043c\u0454\u0442, \u00a2\u03c3\u03b7\u0455\u0454\u00a2\u0442#",
    "<%= user %> has been successfully added to the exception list. Click Generate Exception Certificate below to send the certificate.": "<%= user %> h\u00e4s \u00df\u00e9\u00e9n s\u00fc\u00e7\u00e7\u00e9ssf\u00fcll\u00fd \u00e4dd\u00e9d t\u00f6 th\u00e9 \u00e9x\u00e7\u00e9pt\u00ef\u00f6n l\u00efst. \u00c7l\u00ef\u00e7k G\u00e9n\u00e9r\u00e4t\u00e9 \u00c9x\u00e7\u00e9pt\u00ef\u00f6n \u00c7\u00e9rt\u00eff\u00ef\u00e7\u00e4t\u00e9 \u00df\u00e9l\u00f6w t\u00f6 s\u00e9nd th\u00e9 \u00e7\u00e9rt\u00eff\u00ef\u00e7\u00e4t\u00e9. \u2c60'\u03c3\u044f\u0454\u043c \u03b9\u03c1\u0455#",
    "A Password is required": "\u00c0 P\u00e4ssw\u00f6rd \u00efs r\u00e9q\u00fc\u00efr\u00e9d \u2c60'\u03c3\u044f\u0454\u043c \u03b9\u03c1\u0455\u03c5\u043c \u2202\u03c3\u0142\u03c3\u044f \u0455\u03b9\u0442 \u03b1\u043c\u0454\u0442, \u00a2#",
    "A driver's license, passport, or other government-issued ID with your name and photo": "\u00c0 dr\u00efv\u00e9r's l\u00ef\u00e7\u00e9ns\u00e9, p\u00e4ssp\u00f6rt, \u00f6r \u00f6th\u00e9r g\u00f6v\u00e9rnm\u00e9nt-\u00efss\u00fc\u00e9d \u00ccD w\u00efth \u00fd\u00f6\u00fcr n\u00e4m\u00e9 \u00e4nd ph\u00f6t\u00f6 \u2c60'\u03c3\u044f\u0454\u043c \u03b9\u03c1\u0455\u03c5\u043c \u2202\u03c3\u0142\u03c3\u044f \u0455\u03b9\u0442 \u03b1\u043c\u0454\u0442, \u00a2\u03c3\u03b7\u0455\u0454\u00a2\u0442#",
    "A highlight to look forward to this week.": "\u00c0 h\u00efghl\u00efght t\u00f6 l\u00f6\u00f6k f\u00f6rw\u00e4rd t\u00f6 th\u00efs w\u00e9\u00e9k. \u2c60'\u03c3\u044f\u0454\u043c \u03b9\u03c1\u0455\u03c5\u043c \u2202\u03c3\u0142\u03c3\u044f \u0455\u03b9\u0442 \u03b1\u043c\u0454\u0442, \u00a2\u03c3\u03b7\u0455\u0454\u00a2\u0442\u0454\u0442\u03c5\u044f #",
    "A list of courses you have just enrolled in as a verified student": "\u00c0 l\u00efst \u00f6f \u00e7\u00f6\u00fcrs\u00e9s \u00fd\u00f6\u00fc h\u00e4v\u00e9 j\u00fcst \u00e9nr\u00f6ll\u00e9d \u00efn \u00e4s \u00e4 v\u00e9r\u00eff\u00ef\u00e9d st\u00fcd\u00e9nt \u2c60'\u03c3\u044f\u0454\u043c \u03b9\u03c1\u0455\u03c5\u043c \u2202\u03c3\u0142\u03c3\u044f \u0455\u03b9\u0442 \u03b1\u043c\u0454\u0442, \u00a2\u03c3\u03b7\u0455\u0454\u00a2\u0442\u0454\u0442\u03c5\u044f \u03b1#",
    "A name that identifies your team (maximum 255 characters).": "\u00c0 n\u00e4m\u00e9 th\u00e4t \u00efd\u00e9nt\u00eff\u00ef\u00e9s \u00fd\u00f6\u00fcr t\u00e9\u00e4m (m\u00e4x\u00efm\u00fcm 255 \u00e7h\u00e4r\u00e4\u00e7t\u00e9rs). \u2c60'\u03c3\u044f\u0454\u043c \u03b9\u03c1\u0455\u03c5\u043c \u2202\u03c3\u0142\u03c3\u044f \u0455\u03b9\u0442 \u03b1\u043c\u0454\u0442, \u00a2\u03c3\u03b7\u0455\u0454\u00a2\u0442\u0454\u0442\u03c5\u044f \u03b1#",
    "A short description of the team to help other learners understand the goals or direction of the team (maximum 300 characters).": "\u00c0 sh\u00f6rt d\u00e9s\u00e7r\u00efpt\u00ef\u00f6n \u00f6f th\u00e9 t\u00e9\u00e4m t\u00f6 h\u00e9lp \u00f6th\u00e9r l\u00e9\u00e4rn\u00e9rs \u00fcnd\u00e9rst\u00e4nd th\u00e9 g\u00f6\u00e4ls \u00f6r d\u00efr\u00e9\u00e7t\u00ef\u00f6n \u00f6f th\u00e9 t\u00e9\u00e4m (m\u00e4x\u00efm\u00fcm 300 \u00e7h\u00e4r\u00e4\u00e7t\u00e9rs). \u2c60'\u03c3\u044f\u0454\u043c#",
    "A valid email address is required": "\u00c0 v\u00e4l\u00efd \u00e9m\u00e4\u00efl \u00e4ddr\u00e9ss \u00efs r\u00e9q\u00fc\u00efr\u00e9d \u2c60'\u03c3\u044f\u0454\u043c \u03b9\u03c1\u0455\u03c5\u043c \u2202\u03c3\u0142\u03c3\u044f \u0455\u03b9\u0442 \u03b1\u043c\u0454\u0442, \u00a2\u03c3\u03b7\u0455\u0454\u00a2\u0442\u0454#",
    "ABCDEFGHIJKLMNOPQRSTUVWXYZ": "\u00c0B\u00c7D\u00c9FGH\u00ccJKLMN\u00d6PQRST\u00dbVWX\u00ddZ \u2c60'\u03c3\u044f\u0454\u043c \u03b9\u03c1\u0455\u03c5\u043c \u2202\u03c3\u0142\u03c3\u044f \u0455\u03b9\u0442 \u03b1\u043c\u0454\u0442, \u00a2\u03c3\u03b7\u0455#",
    "API Key": "\u00c0P\u00cc K\u00e9\u00fd \u2c60'\u03c3\u044f\u0454\u043c \u03b9\u03c1\u0455\u03c5\u043c #",
