    "Choose a Date": "Elektu daton",
    "Choose a Time": "Elektu horon",
    "Choose a content group to associate": "\u00c7h\u00f6\u00f6s\u00e9 \u00e4 \u00e7\u00f6nt\u00e9nt gr\u00f6\u00fcp t\u00f6 \u00e4ss\u00f6\u00e7\u00ef\u00e4t\u00e9 \u2c60'\u03c3\u044f\u0454\u043c \u03b9\u03c1\u0455\u03c5\u043c \u2202\u03c3\u0142\u03c3\u044f \u0455\u03b9\u0442 \u03b1\u043c\u0454\u0442, \u00a2\u03c3\u03b7\u0455\u0454\u00a2\u0442\u0454\u0442#",
    "Choose a location to move your component to": "\u00c7h\u00f6\u00f6s\u00e9 \u00e4 l\u00f6\u00e7\u00e4t\u00ef\u00f6n t\u00f6 m\u00f6v\u00e9 \u00fd\u00f6\u00fcr \u00e7\u00f6mp\u00f6n\u00e9nt t\u00f6 \u2c60'\u03c3\u044f\u0454\u043c \u03b9\u03c1\u0455\u03c5\u043c \u2202\u03c3\u0142\u03c3\u044f \u0455\u03b9\u0442 \u03b1\u043c\u0454\u0442, \u00a2\u03c3\u03b7\u0455\u0454\u00a2\u0442\u0454\u0442\u03c5\u044f #",
    "Choose a time": "Elektu tempon",
    "Choose all": "Elekti \u0109iuj",
    "Choose mode": "\u00c7h\u00f6\u00f6s\u00e9 m\u00f6d\u00e9 \u2c60'\u03c3\u044f\u0454\u043c \u03b9\u03c1\u0455\u03c5\u043c \u2202\u03c3\u0142\u03c3\u044f #",
    "Choose new file": "\u00c7h\u00f6\u00f6s\u00e9 n\u00e9w f\u00efl\u00e9 \u2c60'\u03c3\u044f\u0454\u043c \u03b9\u03c1\u0455\u03c5\u043c \u2202\u03c3\u0142\u03c3\u044f \u0455\u03b9\u0442 \u03b1#",
    "Choose one": "\u00c7h\u00f6\u00f6s\u00e9 \u00f6n\u00e9 \u2c60'\u03c3\u044f\u0454\u043c \u03b9\u03c1\u0455\u03c5\u043c \u2202\u03c3\u0142\u03c3#",
    "Choose your institution from the list below:": "\u00c7h\u00f6\u00f6s\u00e9 \u00fd\u00f6\u00fcr \u00efnst\u00eft\u00fct\u00ef\u00f6n fr\u00f6m th\u00e9 l\u00efst \u00df\u00e9l\u00f6w: \u2c60'\u03c3\u044f\u0454\u043c \u03b9\u03c1\u0455\u03c5\u043c \u2202\u03c3\u0142\u03c3\u044f \u0455\u03b9\u0442 \u03b1\u043c\u0454\u0442, \u00a2\u03c3\u03b7\u0455\u0454\u00a2\u0442\u0454\u0442\u03c5\u044f #",
    "Chosen %s": "Elektita %s",
    "Circle": "\u00c7\u00efr\u00e7l\u00e9 \u2c60'\u03c3\u044f\u0454\u043c \u03b9\u03c1\u0455\u03c5#",
    "Clear": "\u00c7l\u00e9\u00e4r \u2c60'\u03c3\u044f\u0454\u043c \u03b9\u03c1\u0455#",
    "Clear All": "\u00c7l\u00e9\u00e4r \u00c0ll \u2c60'\u03c3\u044f\u0454\u043c \u03b9\u03c1\u0455\u03c5\u043c \u2202\u03c3\u0142#",
