    "Could not find a user with username or email address '<%- identifier %>'.": "\u00c7\u00f6\u00fcld n\u00f6t f\u00efnd \u00e4 \u00fcs\u00e9r w\u00efth \u00fcs\u00e9rn\u00e4m\u00e9 \u00f6r \u00e9m\u00e4\u00efl \u00e4ddr\u00e9ss '<%- identifier %>'. \u2c60'\u03c3\u044f\u0454\u043c \u03b9\u03c1\u0455\u03c5\u043c \u2202\u03c3\u0142\u03c3\u044f \u0455\u03b9\u0442 \u03b1\u043c\u0454\u0442, \u00a2\u03c3\u03b7\u0455\u0454\u00a2\u0442\u0454\u0442\u03c5\u044f \u03b1#",
    "Could not find the specified string.": "\u00c7\u00f6\u00fcld n\u00f6t f\u00efnd th\u00e9 sp\u00e9\u00e7\u00eff\u00ef\u00e9d str\u00efng. \u2c60'\u03c3\u044f\u0454\u043c \u03b9\u03c1\u0455\u03c5\u043c \u2202\u03c3\u0142\u03c3\u044f \u0455\u03b9\u0442 \u03b1\u043c\u0454\u0442, \u00a2\u03c3\u03b7\u0455\u0454\u00a2\u0442\u0454\u0442\u03c5#",
    "Could not find users associated with the following identifiers:": "\u00c7\u00f6\u00fcld n\u00f6t f\u00efnd \u00fcs\u00e9rs \u00e4ss\u00f6\u00e7\u00ef\u00e4t\u00e9d w\u00efth th\u00e9 f\u00f6ll\u00f6w\u00efng \u00efd\u00e9nt\u00eff\u00ef\u00e9rs: \u2c60'\u03c3\u044f\u0454\u043c \u03b9\u03c1\u0455\u03c5\u043c \u2202\u03c3\u0142\u03c3\u044f \u0455\u03b9\u0442 \u03b1\u043c\u0454\u0442, \u00a2\u03c3\u03b7\u0455\u0454\u00a2\u0442\u0454\u0442\u03c5\u044f \u03b1#",
