    "If you proceed, you will be unable to use this account to take courses on the {platformName} app, {siteName}, or any other site hosted by {platformName}.": "\u00ccf \u00fd\u00f6\u00fc pr\u00f6\u00e7\u00e9\u00e9d, \u00fd\u00f6\u00fc w\u00efll \u00df\u00e9 \u00fcn\u00e4\u00dfl\u00e9 t\u00f6 \u00fcs\u00e9 th\u00efs \u00e4\u00e7\u00e7\u00f6\u00fcnt t\u00f6 t\u00e4k\u00e9 \u00e7\u00f6\u00fcrs\u00e9s \u00f6n th\u00e9 {platformName} \u00e4pp, {siteName}, \u00f6r \u00e4n\u00fd \u00f6th\u00e9r s\u00eft\u00e9 h\u00f6st\u00e9d \u00df\u00fd {platformName}. \u2c60'\u03c3\u044f\u0454\u043c \u03b9#",
    "If you remove this transcript, the transcript will not be available for any components that use this video.": "\u00ccf \u00fd\u00f6\u00fc r\u00e9m\u00f6v\u00e9 th\u00efs tr\u00e4ns\u00e7r\u00efpt, th\u00e9 tr\u00e4ns\u00e7r\u00efpt w\u00efll n\u00f6t \u00df\u00e9 \u00e4v\u00e4\u00efl\u00e4\u00dfl\u00e9 f\u00f6r \u00e4n\u00fd \u00e7\u00f6mp\u00f6n\u00e9nts th\u00e4t \u00fcs\u00e9 th\u00efs v\u00efd\u00e9\u00f6. \u2c60'\u03c3\u044f\u0454\u043c \u03b9\u03c1\u0455\u03c5\u043c \u2202\u03c3\u0142\u03c3\u044f \u0455\u03b9\u0442#",
