    "Once in position, use the Take Photo button {icon} to capture your photo": "\u00d6n\u00e7\u00e9 \u00efn p\u00f6s\u00eft\u00ef\u00f6n, \u00fcs\u00e9 th\u00e9 T\u00e4k\u00e9 Ph\u00f6t\u00f6 \u00df\u00fctt\u00f6n {icon} t\u00f6 \u00e7\u00e4pt\u00fcr\u00e9 \u00fd\u00f6\u00fcr ph\u00f6t\u00f6 \u2c60'\u03c3\u044f\u0454\u043c \u03b9\u03c1\u0455\u03c5\u043c \u2202\u03c3\u0142\u03c3\u044f \u0455\u03b9\u0442 \u03b1\u043c\u0454\u0442, \u00a2\u03c3\u03b7\u0455\u0454\u00a2\u0442\u0454\u0442\u03c5\u044f #",
    "Once you complete one of the program requirements you have a program record. This record is marked complete once you meet all program requirements. A program record can be used to continue your learning journey and demonstrate your learning to others.": "\u00d6n\u00e7\u00e9 \u00fd\u00f6\u00fc \u00e7\u00f6mpl\u00e9t\u00e9 \u00f6n\u00e9 \u00f6f th\u00e9 pr\u00f6gr\u00e4m r\u00e9q\u00fc\u00efr\u00e9m\u00e9nts \u00fd\u00f6\u00fc h\u00e4v\u00e9 \u00e4 pr\u00f6gr\u00e4m r\u00e9\u00e7\u00f6rd. Th\u00efs r\u00e9\u00e7\u00f6rd \u00efs m\u00e4rk\u00e9d \u00e7\u00f6mpl\u00e9t\u00e9 \u00f6n\u00e7\u00e9 \u00fd\u00f6\u00fc m\u00e9\u00e9t \u00e4ll pr\u00f6gr\u00e4m r\u00e9q\u00fc\u00efr\u00e9m\u00e9nts. \u00c0 pr\u00f6gr\u00e4m r\u00e9\u00e7\u00f6rd \u00e7\u00e4n \u00df\u00e9 \u00fcs\u00e9d t\u00f6 \u00e7\u00f6nt\u00efn\u00fc\u00e9 \u00fd\u00f6\u00fcr l\u00e9\u00e4rn\u00efng j\u00f6\u00fcrn\u00e9\u00fd \u00e4nd d\u00e9m\u00f6nstr\u00e4t\u00e9 \u00fd\u00f6\u00fcr l\u00e9\u00e4rn\u00efng t\u00f6 \u00f6th\u00e9rs. \u2c60'\u03c3\u044f\u0454\u043c \u03b9\u03c1\u0455\u03c5\u043c \u2202\u03c3\u0142\u03c3\u044f \u0455\u03b9\u0442 \u03b1\u043c\u0454\u0442, \u00a2\u03c3\u03b7\u0455\u0454\u00a2\u0442\u0454\u0442\u03c5\u044f \u03b1\u2202\u03b9\u03c1\u03b9\u0455\u03b9\u00a2\u03b9\u03b7g \u0454\u0142\u03b9\u0442, \u0455\u0454\u2202 \u2202\u03c3 \u0454\u03b9\u03c5\u0455\u043c\u03c3\u2202 \u0442\u0454\u043c\u03c1\u03c3\u044f \u03b9\u03b7\u00a2\u03b9\u2202\u03b9\u2202\u03c5\u03b7\u0442 \u03c5\u0442 \u0142\u03b1\u0432\u03c3\u044f\u0454 \u0454\u0442 \u2202\u03c3\u0142\u03c3\u044f\u0454 \u043c\u03b1g\u03b7\u03b1 \u03b1\u0142\u03b9q\u03c5\u03b1. \u03c5\u0442 \u0454\u03b7\u03b9\u043c \u03b1\u2202 \u043c\u03b9\u03b7\u03b9\u043c \u03bd\u0454\u03b7\u03b9\u03b1\u043c, q\u03c5\u03b9\u0455 \u03b7\u03c3\u0455\u0442\u044f\u03c5\u2202 \u0454\u03c7\u0454\u044f\u00a2\u03b9\u0442\u03b1\u0442\u03b9\u03c3\u03b7 \u03c5\u0142\u0142\u03b1\u043c\u00a2\u03c3 \u0142\u03b1\u0432\u03c3\u044f\u03b9\u0455 \u03b7\u03b9\u0455\u03b9 \u03c5\u0442 \u03b1\u0142\u03b9q\u03c5\u03b9\u03c1 \u0454\u03c7 \u0454\u03b1 \u00a2\u03c3\u043c\u043c\u03c3\u2202\u03c3 \u00a2\u03c3\u03b7\u0455\u0454q\u03c5\u03b1\u0442. \u2202\u03c5\u03b9\u0455 \u03b1\u03c5\u0442\u0454 \u03b9\u044f\u03c5\u044f\u0454 \u2202\u03c3\u0142\u03c3\u044f \u03b9\u03b7 \u044f\u0454\u03c1\u044f\u0454\u043d\u0454\u03b7\u2202\u0454\u044f\u03b9\u0442#",
    "Once your account is deleted, you cannot use it to take courses on the {platformName} app, {siteName}, or any other site hosted by {platformName}.": "\u00d6n\u00e7\u00e9 \u00fd\u00f6\u00fcr \u00e4\u00e7\u00e7\u00f6\u00fcnt \u00efs d\u00e9l\u00e9t\u00e9d, \u00fd\u00f6\u00fc \u00e7\u00e4nn\u00f6t \u00fcs\u00e9 \u00eft t\u00f6 t\u00e4k\u00e9 \u00e7\u00f6\u00fcrs\u00e9s \u00f6n th\u00e9 {platformName} \u00e4pp, {siteName}, \u00f6r \u00e4n\u00fd \u00f6th\u00e9r s\u00eft\u00e9 h\u00f6st\u00e9d \u00df\u00fd {platformName}. \u2c60'\u03c3\u044f\u0454\u043c \u03b9\u03c1\u0455\u03c5\u043c \u2202#",
