    "Option Deleted": "\u00d6pt\u00ef\u00f6n D\u00e9l\u00e9t\u00e9d \u2c60'\u03c3\u044f\u0454\u043c \u03b9\u03c1\u0455\u03c5\u043c \u2202\u03c3\u0142\u03c3\u044f \u0455\u03b9\u0442#",
    "Optional Characteristics": "\u00d6pt\u00ef\u00f6n\u00e4l \u00c7h\u00e4r\u00e4\u00e7t\u00e9r\u00efst\u00ef\u00e7s \u2c60'\u03c3\u044f\u0454\u043c \u03b9\u03c1\u0455\u03c5\u043c \u2202\u03c3\u0142\u03c3\u044f \u0455\u03b9\u0442 \u03b1\u043c\u0454\u0442, \u00a2\u03c3\u03b7#",
