    "The assignment type must have a name.": "Th\u00e9 \u00e4ss\u00efgnm\u00e9nt t\u00fdp\u00e9 m\u00fcst h\u00e4v\u00e9 \u00e4 n\u00e4m\u00e9. \u2c60'\u03c3\u044f\u0454\u043c \u03b9\u03c1\u0455\u03c5\u043c \u2202\u03c3\u0142\u03c3\u044f \u0455\u03b9\u0442 \u03b1\u043c\u0454\u0442, \u00a2\u03c3\u03b7\u0455\u0454\u00a2\u0442\u0454\u0442\u03c5#",
    "The certificate available date must be later than the course end date.": "Th\u00e9 \u00e7\u00e9rt\u00eff\u00ef\u00e7\u00e4t\u00e9 \u00e4v\u00e4\u00efl\u00e4\u00dfl\u00e9 d\u00e4t\u00e9 m\u00fcst \u00df\u00e9 l\u00e4t\u00e9r th\u00e4n th\u00e9 \u00e7\u00f6\u00fcrs\u00e9 \u00e9nd d\u00e4t\u00e9. \u2c60'\u03c3\u044f\u0454\u043c \u03b9\u03c1\u0455\u03c5\u043c \u2202\u03c3\u0142\u03c3\u044f \u0455\u03b9\u0442 \u03b1\u043c\u0454\u0442, \u00a2\u03c3\u03b7\u0455\u0454\u00a2\u0442\u0454\u0442\u03c5\u044f #",
    "The certificate for this learner has been re-validated and the system is re-running the grade for this learner.": "Th\u00e9 \u00e7\u00e9rt\u00eff\u00ef\u00e7\u00e4t\u00e9 f\u00f6r th\u00efs l\u00e9\u00e4rn\u00e9r h\u00e4s \u00df\u00e9\u00e9n r\u00e9-v\u00e4l\u00efd\u00e4t\u00e9d \u00e4nd th\u00e9 s\u00fdst\u00e9m \u00efs r\u00e9-r\u00fcnn\u00efng th\u00e9 gr\u00e4d\u00e9 f\u00f6r th\u00efs l\u00e9\u00e4rn\u00e9r. \u2c60'\u03c3\u044f\u0454\u043c \u03b9\u03c1\u0455\u03c5\u043c \u2202\u03c3\u0142\u03c3\u044f #",
