    "Type in a URL or use the \"Choose File\" button to upload a file from your machine. (e.g. 'http://example.com/img/clouds.jpg')": "T\u00fdp\u00e9 \u00efn \u00e4 \u00dbRL \u00f6r \u00fcs\u00e9 th\u00e9 \"\u00c7h\u00f6\u00f6s\u00e9 F\u00efl\u00e9\" \u00df\u00fctt\u00f6n t\u00f6 \u00fcpl\u00f6\u00e4d \u00e4 f\u00efl\u00e9 fr\u00f6m \u00fd\u00f6\u00fcr m\u00e4\u00e7h\u00efn\u00e9. (\u00e9.g. 'http://\u00e9x\u00e4mpl\u00e9.\u00e7\u00f6m/\u00efmg/\u00e7l\u00f6\u00fcds.jpg') \u2c60'\u03c3\u044f\u0454\u043c \u03b9#",
    "Type into this box to filter down the list of available %s.": "Entipu en \u0109i-tiu skatolo por filtri la liston de haveblaj %s.",
    "URL": "\u00dbRL \u2c60'\u03c3\u044f\u0454\u043c#",
    "Unable to delete account": "\u00dbn\u00e4\u00dfl\u00e9 t\u00f6 d\u00e9l\u00e9t\u00e9 \u00e4\u00e7\u00e7\u00f6\u00fcnt \u2c60'\u03c3\u044f\u0454\u043c \u03b9\u03c1\u0455\u03c5\u043c \u2202\u03c3\u0142\u03c3\u044f \u0455\u03b9\u0442 \u03b1\u043c\u0454\u0442, \u00a2\u03c3\u03b7#",
    "Unable to determine whether we should give you a refund because of System Error. Please try again later.": "\u00dbn\u00e4\u00dfl\u00e9 t\u00f6 d\u00e9t\u00e9rm\u00efn\u00e9 wh\u00e9th\u00e9r w\u00e9 sh\u00f6\u00fcld g\u00efv\u00e9 \u00fd\u00f6\u00fc \u00e4 r\u00e9f\u00fcnd \u00df\u00e9\u00e7\u00e4\u00fcs\u00e9 \u00f6f S\u00fdst\u00e9m \u00c9rr\u00f6r. Pl\u00e9\u00e4s\u00e9 tr\u00fd \u00e4g\u00e4\u00efn l\u00e4t\u00e9r. \u2c60'\u03c3\u044f\u0454\u043c \u03b9\u03c1\u0455\u03c5\u043c \u2202\u03c3\u0142\u03c3\u044f \u0455\u03b9\u0442 \u03b1#",
    "Unable to get report generation status.": "\u00dbn\u00e4\u00dfl\u00e9 t\u00f6 g\u00e9t r\u00e9p\u00f6rt g\u00e9n\u00e9r\u00e4t\u00ef\u00f6n st\u00e4t\u00fcs. \u2c60'\u03c3\u044f\u0454\u043c \u03b9\u03c1\u0455\u03c5\u043c \u2202\u03c3\u0142\u03c3\u044f \u0455\u03b9\u0442 \u03b1\u043c\u0454\u0442, \u00a2\u03c3\u03b7\u0455\u0454\u00a2\u0442\u0454\u0442\u03c5\u044f#",
