    "Use the Retake Photo button if you are not pleased with your photo": "\u00dbs\u00e9 th\u00e9 R\u00e9t\u00e4k\u00e9 Ph\u00f6t\u00f6 \u00df\u00fctt\u00f6n \u00eff \u00fd\u00f6\u00fc \u00e4r\u00e9 n\u00f6t pl\u00e9\u00e4s\u00e9d w\u00efth \u00fd\u00f6\u00fcr ph\u00f6t\u00f6 \u2c60'\u03c3\u044f\u0454\u043c \u03b9\u03c1\u0455\u03c5\u043c \u2202\u03c3\u0142\u03c3\u044f \u0455\u03b9\u0442 \u03b1\u043c\u0454\u0442, \u00a2\u03c3\u03b7\u0455\u0454\u00a2\u0442\u0454\u0442\u03c5\u044f #",
    "Use your webcam to take a photo of your ID.": "\u00dbs\u00e9 \u00fd\u00f6\u00fcr w\u00e9\u00df\u00e7\u00e4m t\u00f6 t\u00e4k\u00e9 \u00e4 ph\u00f6t\u00f6 \u00f6f \u00fd\u00f6\u00fcr \u00ccD. \u2c60'\u03c3\u044f\u0454\u043c \u03b9\u03c1\u0455\u03c5\u043c \u2202\u03c3\u0142\u03c3\u044f \u0455\u03b9\u0442 \u03b1\u043c\u0454\u0442, \u00a2\u03c3\u03b7\u0455\u0454\u00a2\u0442\u0454\u0442\u03c5\u044f #",
    "Use your webcam to take a photo of your face. We will match this photo with the photo on your ID.": "\u00dbs\u00e9 \u00fd\u00f6\u00fcr w\u00e9\u00df\u00e7\u00e4m t\u00f6 t\u00e4k\u00e9 \u00e4 ph\u00f6t\u00f6 \u00f6f \u00fd\u00f6\u00fcr f\u00e4\u00e7\u00e9. W\u00e9 w\u00efll m\u00e4t\u00e7h th\u00efs ph\u00f6t\u00f6 w\u00efth th\u00e9 ph\u00f6t\u00f6 \u00f6n \u00fd\u00f6\u00fcr \u00ccD. \u2c60'\u03c3\u044f\u0454\u043c \u03b9\u03c1\u0455\u03c5\u043c \u2202\u03c3\u0142\u03c3\u044f \u0455\u03b9\u0442 \u03b1\u043c\u0454\u0442, #",
