    "What industry do you want to work in?": "Wh\u00e4t \u00efnd\u00fcstr\u00fd d\u00f6 \u00fd\u00f6\u00fc w\u00e4nt t\u00f6 w\u00f6rk \u00efn? \u2c60'\u03c3\u044f\u0454\u043c \u03b9\u03c1\u0455\u03c5\u043c \u2202\u03c3\u0142\u03c3\u044f \u0455\u03b9\u0442 \u03b1\u043c\u0454\u0442, \u00a2\u03c3\u03b7\u0455\u0454\u00a2\u0442\u0454\u0442\u03c5#",
